import Card from './Card';

export default function Cards({characters}) {

   return (
   <div>
      {
         characters.map(({id, name, status, species, origin, gender, image}) =>{
            return(
               <Card
                  key = {id}
                  id = {id}
                  name = {name}
                  status = {status}
                  species = {species}
                  origin= {origin.name}
                  gender={gender}
                  image={image}
                  onClose={() => alert('Emulamos que se cierra la card')}
               />
            )
         })
      }
   </div>
   );
}
